INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64266ccf4b30166e90691070032', '<h4>退款</h4>\r\n套餐内按照使用次数计算服务费，剩余的金额退回；\r\n提交退款申请，将会在3~7个工作日退回原支付账户；\r\n平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n<p>\r\n服务内容：\r\n<br>1.表达关心：向探望对象传达客户的关心、惦念与对疾病康复的祝愿。\r\n<br>2.基础护理：更衣、翻身拍背、辅助进食服药等生活护理，代替家人亲友给予更专业的陪伴。\r\n<br>3.病情监护：从专业的角度更密切关注病情的变化，及时与主管医生沟通，向家属及委托人汇报。\r\n<br>4.心理疏导：悉心陪伴、耐心疏导，帮助客户缓解疾病焦虑，增强康复信心。\r\n<br>5.生活指导：\r\n根据患者病情与生活习惯，给出饮食、锻炼、康复建议\r\n</p>\r\n', NULL, '2018-11-06 20:36:54', '/images/20181106/1541508523255.jpg', '住院探视护理', 300, NULL, '\r\n1.住院探视护理不提供住院护士职责范围内的专业护理；\r\n2.本服务仅针对患者本人服务。\r\n3.本次服务时长为90分钟，超出时长按照20分钟一个单位加收40元。\r\n4.套餐内次数，有效期为一年。\r\n5.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<p>平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）</p>\r\n\r\n', '2c92b642662e966801664912026f0022');
INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64266ccf4b30166e9072dbf0033', '<h4>退款</h4>\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br>提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br>平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n\r\n<h4>注意事项</h4>\r\n\r\n<br>1.	注意保持皮肤清洁及干燥,促进组织修复；\r\n<br>2.	避免提重物及剧烈的运动，穿衣要宽松,避免压迫造口；\r\n<br>3.	出现以下情况时，请及时到医院处理：造囗坏死、严重的造口回缩、严重的造口狭窄、造口脱垂、严重的造口撕裂等；\r\n<br>4.	结肠造口建议在饭前或饮食后2小时进行造口袋的更换,或者根据患者的排便习惯安排换袋时机,请根据自己的换袋时间在平台上下单预约；\r\n<br>5.	受限于客观条件，具有攻击性、易产生过激反应的患者不在服务范围以内；\r\n<br>6.	护理项目需要家属陪同，如家属无法陪同请谨慎使用此护理服务；\r\n<p>\r\n<br>护理工具：\r\n<br>造口护理医疗包（如需使用人工肛袋需自备）\r\n<br>种类                    规格/数量\r\n<br>一次性换药包             通用1\r\n<br>无菌手套                 中号1 \r\n<br>医用纱布块              通用若干\r\n<br>无菌棉签                通用若干\r\n<br>医用胶布                通用若干\r\n<br>注：耗材具体费用根据医疗机构标准定价收取\r\n<br>如我们提供的服务耗材包无您所需耗材，请备注或者在医护回访中说明。\r\n</p>\r\n\r\n疾病选择: 无,短期造口,长期造口\r\n', NULL, '2018-11-06 20:37:34', '/images/20181106/1541508497633.jpg', '造口护理', 180, NULL, '\r\n<br>1.	本服务只提供造口护理技术服务，相关医疗耗材需用户自备；\r\n<br>2.	本次服务时长为60分钟，超出时长按照20分钟一个单位加收40元。\r\n<br>3.	套餐内次数，有效期为一年。\r\n<br>4.	本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n\r\n<br>平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n', '2c92b642662e966801664912026f0022');
INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64266ccf4b30166e90786250034', '<h4>退款</h4>\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br>提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br>平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n<h4>注意事项</h4>\r\n<br>1、受限于客观条件，具有攻击性、易产生过激反应的患者不在服务范围以内；\r\n<br>2、保持创伤部位清洁干燥,请勿沾水；尽量减少创伤部位的活动,以免出现渗血等现象；\r\n<br>3、伤口严重感染或坏死、大量活动性岀血者不提供上门换药服务。\r\n<br>4、护理项目需要家属陪同，如家属无法陪同请谨慎使用此护理服务；\r\n<p>\r\n\r\n\r\n疾病选择:  无 ,多发创伤,老年患者,骨盆骨折,慢性阻塞性肺气肿,脑出血,,中风,心衰,昏迷,瘫痪,神经系统疾病,肥胖,营养不佳,肿瘤疼痛,糖尿病,血液病</P>\r\n', NULL, '2018-11-06 20:37:56', '/images/20181106/1541508481695.jpg', '压疮换药', 250, NULL, '\r\n<br>1.	本服务只提供压疮护理技术服务，相关医疗耗材需用户自备；\r\n<br>2.	本次服务时长为50分钟，超出时长按照20分钟一个单位加收40元。\r\n<br>3.	护士上门一次可为患者提供三个部位的护理服务，每个部位护理面积不超过10*10cm。超出规定范围，按照30元/3个部位额外收取费用。\r\n<br>4.	根据压疮的分期，采取不同的护理措施。\r\n<br>5.	套餐内次数，有效期为一年。\r\n<br>6.	本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n\r\n<p>平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）</p>\r\n\r\n', '2c92b642662e966801664912026f0022');
