INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64266ccf4b30166e908d1b70038', '<h4>退款</h4>\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br>提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br>平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n<h4>服务内容：</h4>\r\n\r\n<br>1.	基本生命体征监测：\r\n<br>2.	定期监测体温、脉搏、呼吸、血压等，关注基础健康状况。\r\n<br>3.	定期血糖监测：\r\n<br>4.	定期监测血糖，预防糖尿病及糖尿病并发症。\r\n<br>5.	慢病康复与用药情况跟踪指导：\r\n<br>6.	对老人慢病康复情况进行跟踪指导，遵循医嘱保证安全正确用药，指导非处方药运用，观察药物不良反应，建议医生调药，避免错服漏服，及时发现慢病情况变化，指导及时就医。\r\n<br>7.	营养饮食指导：\r\n<br>8.	根据个人营养健康、用药情况、运动习惯，指导优化营养饮食方案。\r\n<br>9.	心理护理：\r\n<br>10.	悉心疏导与耐心关怀帮助患者建立康复信心，提升生活质量。\r\n<br>11.	居家安全指数评估：\r\n<br>12.	协助发现居家安全隐患，降低意外危险事件概率，如跌倒、坠压、压疮等。\r\n<br>13.	安全护理：\r\n<br>14.	家居安全评估，合理布局。改善危险因素，避免受伤、跌倒、误服、走失等危险。\r\n<br>15.	运动锻炼指导：\r\n<br>16.	根据个人身体状况，指导适度锻炼与适宜锻炼方式，避免不当和过度运动。\r\n', NULL, '2018-11-06 20:39:21', '/images/20181106/1541508393418.jpg', '护士到家', 200, NULL, '<p>\r\n<br>1.	本服务只为用户提供相关专业服务，不含家政服务；\r\n<br>2.	本服务仅针对患者本人提供服务；\r\n<br>3.	本次服务时长为60分钟内，超出时长按照20分钟一个单位加收40元。\r\n<br>4.	套餐内次数，有效期为一年。\r\n<br>5.	本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<br>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n</p>\r\n', '2c92b642662e966801664912026f0022');
INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64266ccf4b30166e90910b70039', '<h4>退款</h4>\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br>提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br>平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n\r\n<h4>注意事项</h4>\r\n存在以下风险\r\n<br>1.感染\r\n<br>2.血尿\r\n<br>3.膀胱刺激症状\r\n<br>4膀胱痉挛、麻痹\r\n<br>5.膀胱破裂\r\n<br>6.突发其他疾病等情况\r\n</p>\r\n\r\n<h4>知情同意书</h4>\r\n<p>\r\n由于院外护理条件欠缺,岀现突发情况而超岀护士职责范围的，护土及时通知家属并呼叫120救护中心,如病情突然加重，岀现昏厥、呼吸心跳骤停、护士将尽力抢救患者，因此产生的一切后果由患者及家属自行承担。\r\n</p>\r\n<p>\r\n疾病选择： 无，尿失禁，膀胱冲洗，术后，卧床失能，肿瘤，尿潴留\r\n</p>', NULL, '2018-11-06 20:39:37', '/images/20190315/1552623812425.jpg', '膀胱冲洗', 200, NULL, '<p>\r\n<br>1.本服务只针对女性用户，有感染倾向、出血倾向、未婚女性或处于生理期、肿瘤患者等，无法提供服务；        \r\n<br>2.本服务只提供膀胱冲洗服务，相关医疗耗材需用户自备；\r\n<br>3.本次服务时长为60分钟内，超出时长按照20分钟一个单位加收40元。\r\n<br>4.套餐内次数，有效期为一年。\r\n<br>5.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n</p>\r\n<p>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）</p>\r\n', '2c92b642662e966801664912026f0022');
