INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b642686e543d01687961f2bc0021', '<p>\r\n<h4>退款</h4>\r\n\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br> 提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br> 平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n</p>', NULL, '2019-01-23 14:24:49', '/images/20190410/1554856624705.jpg', '留置尿管', 200, NULL, '<p>\r\n<br>1.本服务只提供留置尿管服务，相关医疗耗材需用户自备；特殊材料费另算。\r\n<br>2.本次服务时间为60分钟， 超出时长按照20分钟一个单位加收40元。\r\n<br>3.套餐内次数，有效期为一年。\r\n<br>4.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<br>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n</P>\r\n\r\n<h4><font color=#ff6600>留置尿管注意事项</font></h4>\r\n<br>1.留置导尿管期间，若病情允许，应鼓励患者每日摄取水分2000ML以上，稀释尿液，减少沉淀物，达到自然冲洗尿道的作用，减少尿道感染的机会，也可预防沉淀物过多阻塞尿管。\r\n<br>2.保持尿道口清洁：女性患者用消毒棉球擦拭尿道口及外阴，男性患者擦拭尿道口，龟头及包皮，每天1~2次，\r\n排便后及时清洗肛门及会阴部皮肤。\r\n<br>3.集尿袋的更换：注意观察并及时排空集尿袋内尿液（尿袋里尿液2/3），并记录尿量。避免集尿袋超过耻骨联合（腰部）高度和挤压，防尿液反流。防止倒尿时尿袋出口处受到污染。常规每周更换集尿袋1~2次，若有尿液性状，颜色改变，需及时更换。\r\n<br>4.注意保持引流通畅，指导家属避免导尿管受压，扭曲，堵塞。离床活动时固定好尿管，避免过度拉扯，以防导尿管中的气囊脱出，损伤尿道黏膜。如患者神志不清，躁动不安，应做好约束，并及时观察，避免意外性拔管或脱出，引起血尿。\r\n<br>5.保护膀胱反射功能，采用间歇性夹管方式，夹闭尿管，每3~4小时一次开放一次，使膀胱定时充盈和排空，促进膀胱功能恢复\r\n<br>6.注意患者主诉并观察尿液情况，如出现发烧，发冷，尿道疼痛，尿液混浊，沉淀，有结晶，尿道口分泌物增加应及时就诊。\r\n<p>\r\n', '2c92b642662e966801664912026f0022');
