INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64268983c6c016a66d4246601c4', '<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n</p>\r\n\r\n<h4><font color=#ff6600>雾化机租赁注意事项</font></h4>\r\n<br>1.避免电击，远离水源，勿将电源线或机器浸入液面，注意用电安全，勿用手接触落入水中通电的机器。\r\n<br>2.使用环境要求：周围不要有易燃气体或其他喷出气体颗粒，如有，请立刻停止使用。\r\n<br>3.雾化用药必须是经过医生确认的处方药水\r\n<br>4.产品在家庭使用，应遵照医护人员的指导下使用。\r\n<br>5.请爱护机器，如出现机器人为损坏等无法使用的现象，押金500元将无法退还给您，请理解\r\n<br>6.租凭过程中，请用干纸巾做好清洁，并保存爱护好机器，谢谢\r\n<br>7.患者病情进展跟机器无关，如有病情变化，请及时到医院救治。\r\n', NULL, '2019-04-29 10:02:20', '/images/20190429/1556503055337.jpg', '雾化机租赁', 100, NULL, '<p>\r\n<br>1.尊敬的患者和家属，您好，感谢您对我们的支持，本合约一式两份，请您保管好\r\n<br>2.式雾化机是一家依赤岗护理站的医疗设备，我们将向您收取500元的押金，租金一天10元的费用（从租凭第一天开始计算费用，归还时结算租金。10天起租）\r\n<br>3.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<br>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n</P>\r\n', '2c92b642662e966801664912026f0022');
