INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b64268983c6c016aba28586601e0', '<p>\r\n<h4>退款</h4>\r\n\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br> 提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br> 平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n</p>', NULL, '2019-05-15 14:22:47', '/images/20190515/1557906134058.jpg', '上门更换尿袋', 100, NULL, '<p>\r\n<br>1.本服务只提供更换尿袋服务，相关医疗耗材需用户自备；\r\n<br>2套餐内次数，有效期为一年。\r\n<br>3.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<br>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n</P>\r\n\r\n<h4><font color=#ff6600>更换尿袋注意事项</font></h4>\r\n<br>1. 保持无菌，尽量要带手套的，要是在家里的话，要把手洗干净，尽量不要增加管道与外界的接触。\r\n<br>2. 不要污染了接口处，否则会有尿路感染的可能。\r\n<br>3. 注意拔出旧尿袋的时候，不要拽了尿管。\r\n<br>4. 注意观察尿的颜色，清澈度，预防尿路感染。', '2c92b642662e966801664912026f0022');
INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b6426b15b4f1016b495fddc6000d', '<p>\r\n<h4>退款</h4>\r\n\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br> 提交退款申请，将会在3~7个工作日退回原支付账户；\r\n<br> 平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知护士，护士出发后取消订单，将收取70%的服务费。\r\n</p>', NULL, '2019-06-12 09:49:08', '/images/20190909/1568017582312.jpg', '糖尿病足护理', 250, NULL, '<p>\r\n<br>1.  糖尿病足：糖尿病足是由于糖尿病所致血管和（或）神经病变引起的下肢异常改变的总称。糖尿病足一般预后较差，所以应加强对糖尿病患者足部护理的健康指导。\r\n<br>2. 超出时长按照20分钟一个单位加收40元。\r\n<br>3.套餐内次数，有效期为一年。\r\n<br>4.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<br>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n</P>\r\n\r\n<br><h4>日常注意事项</font></h4>\r\n<br>1.建议患者每日用温水洗脚，水温不超过37℃，应使用中性香皂清洗，不建议泡脚。洗脚后使用吸水性强的毛巾擦干。\r\n<br>2.注意观察下肢，尤其是足部肤色、温度、足背动脉搏动情况、弹性等；是否出现胼胝、鸡眼、趾甲内陷、皲裂、水疱、破溃等足部问题。一旦出现任何足部问题应及时到医院就诊。\r\n<br>3.指导患者学会正确修剪趾甲的方法，应该平剪，不宜剪得过短，以免损伤甲沟，引起感染。\r\n<br>4.糖尿病患者不要赤足行走，要坚持穿棉袜和鞋。冬季应注意保暖，但不要用电热毯、热水袋，以免烫伤。\r\n<br>5.吸烟会加速大血管及微血管的病变，出现足部病变的糖尿病患者要严格戒烟，以免病情加速发展。\r\n<br>6.糖尿病足是糖尿病常见的并发症之一，因此糖尿病足的不同阶段应选择不同的锻炼方式。叮嘱患者站立时间不宜过长。\r\n<br>7.由于糖尿病足部病变的患者病情严重时有截肢的可能，患者易产生焦虑的心理，所以应给予患者心理护理，指导患者保持心情舒畅，树立信心，积极配合治疗。\r\n</p>\r\n\r\n\r\n', '2c92b642662e966801664912026f0022');
