INSERT INTO `T_SERVICE_PRODUCT` VALUES ('2c92b6426c96002a016cfb5474bf000f', '<h4>退款</h4>\r\n<br>套餐内按照使用次数计算服务费，剩余的金额退回；\r\n<br>提交退款申请，将会在3~7个工作日退回原银行账户；\r\n<br>平台优惠券、红包不予退还；\r\n\r\n<h4>取消订单</h4>\r\n<br>预约成功后由于您个人原因取消订单，将收取30%的服务费；\r\n<br>如需修改预约请提前4小时通知，出发后取消订单，将收取70%的服务费。\r\n\r\n<h4><i><font color=#ff6600>服务价格说明</i></font></h4>\r\n<h1><b><font color=#ff6600>该价格为参考价，具体的服务价格需根据康复方案而定</font></b></h1>', NULL, '2019-09-04 16:11:52', '/images/20190904/1567585444032.jpg', '拔罐（上门服务）', 200, NULL, '<p>\r\n<br>1.服务目的：通过玻璃罐具吸拔病变部位或特定经络、穴位，将充斥于体表的病灶及经络、穴位，乃至深层组织器官内的风寒、瘀血、热毒、脓血等，经过在皮肤上的吸拔，排出体外，使邪出正复，经络气血舒畅，达到治疗的目的。\r\n<br>2. 超出时长按照20分钟一个单位加收40元。\r\n<br>3.套餐内次数，有效期为一年。\r\n<br>4.本服务由「护理易」提供，专家团队全程支持，咨询电话：400-0000601.\r\n<br>\r\n平台优势\r\n（执业护士专业服务）（全程投保安全放心）（专家团队随时售后）\r\n</P>\r\n\r\n<h4><font color=#ff6600>拔罐禁忌症</font></h4>\r\n<p>\r\n高热抽搐、痉挛发作者、急性严重疾病、慢性全身虚弱性疾病 、接触性传染病       、出血倾向病人、急性关节口韧带、肌腱严重损伤骨折未愈合口眼、耳、鼻、口腔、皮肤破溃处口局部原因不明肿块\r\n婴幼儿、孕妇腰骶部、腹部、前后阴、乳房、过肌、醉酒、过饱、过度疲劳者、精神失常、精神病发作期、狂躁不安、破伤风、狂犬病等不能配合者\r\n\r\n</P>\r\n\r\n<h4><font color=#ff6600>拔罐风险</font></h4>\r\n<p>\r\n<br>1、局部不适：局部皮肤发热、发紧、发酸、疼痛不适感\r\n<br>2、晕罐：头晕、心慌、恶心、面色苍白、呼吸急促、四肢厥冷、脉细数\r\n<br>3、烫伤：局部出现小水疱\r\n</P> ', '2c92b642662e966801664912026f0022');
